import React, { Component } from 'react'
import ListItemCard from './ListItemCard'

export class ListItemsTable extends Component {
    render() {
        return (
        <div>
            <div className="list_item_header_card" id="list_items_container">
                <div className="list_item_task_header" onClick>Task</div>
                <div className="list_item_due_date_header">Due Date</div>
                <div className="list_item_status_header">Status</div>
                </div>    
                {
                    this.props.todoList.items.map((todoItem)=>(
                        <ListItemCard 
                            key={todoItem.key}
                            listItem={todoItem}
                        />

                    ))
                }
            <script>
            document.getElementById("list_item_header_card").innerHTML = "Hello JavaScript!";
            </script>
            </div>
        )
    }
}

export default ListItemsTable
